openapi: 3.0.0
info:
  title: Google Sheets API
  description: >-
    The Google Sheets API enables developers to read, write, and manage their
    Google Sheets data programmatically. It provides capabilities such as
    modifying spreadsheet content, formatting, and settings and managing
    individual sheets within a spreadsheet.
  version: 1.0.0
servers:
  - url: http://{{baseurl}}
components:
  securitySchemes:
    oauth2Auth:
      type: http
      scheme: oauth2
security:
  - oauth2Auth: []
tags:
  - name: Values
  - name: Batch Values Update
  - name: Sheets
  - name: Metadata
paths:
  /v4/spreadsheets/{spreadsheetId}/values/{range}:
